import React from 'react'
import { Link } from 'react-router-dom'

function StateDetail() {
  return (
    <>
    
      Select District
      <Link to='fzr-cantt' replace={true}>Firozpur  Cantt</Link>
      <Link to='fzr-city' replace={true}>Firozpur City</Link>
    </>
  )
}

export default StateDetail
